import React from 'react'

function ExpensesTable({expenses}) {
    console.log(`expensesTable-->`,ExpensesTable)
  return (
  <>
  <div className='expense-list'>
    {
        expenses?.map((expenses,index)=>
        (

            <div key={index} className='expense-item'>
                <button className='delete-buttom'></button>
                <div className='expense-description'>{expenses.text}</div>
                <div className='expense-amount'>{expenses.amount}</div>
</div>
        ) )
    }
  </div>
  
  </>
  )
}

export default ExpensesTable
